.sidebar {
    color: white;
    display: flex;
    flex-direction: column;
    padding: 20px 0;
}

.sidebar-item, .sidebar-subitem {
    color: black;
    display: flex;
    align-items: center; /* Alinha ícones e texto verticalmente */
    justify-content: flex-start; /* Alinha o conteúdo no início horizontalmente */
    padding: 10px 20px;
    cursor: pointer;
    border-radius: 5px;
    transition: background-color 0.2s, transform 0.3s; /* Adiciona transição suave ao fundo e ao aumento */
    overflow: visible;
}

.sidebar-item img, .sidebar-subitem img,
.sidebar-item .material-symbols-outlined, .sidebar-subitem .material-symbols-outlined {
    margin-right: 8px; /* Espaçamento entre ícone e texto */
    width: 40px; /* Aumenta a largura do ícone */
    height: 40px; /* Aumenta a altura do ícone */
    max-width: 40px; /* Define a largura máxima da imagem */
    max-height: 40px; /* Define a altura máxima da imagem */
    transition: transform 0.3s; /* Adiciona transição suave à imagem */
}

.sidebar-item span, .sidebar-subitem span {
    transition: transform 0.3s; /* Adiciona transição suave ao texto */
    line-height: 1; /* Ajusta a altura da linha para melhor alinhamento vertical */
    display: flex;
    align-items: center; /* Alinha o texto verticalmente com o ícone */
}

.sidebar-item:hover, .sidebar-subitem:hover {
    background-color: rgba(253, 190, 54, 0.9); /* Cor de fundo ao passar o mouse */
    transform: scale(1.02); /* Aumenta o tamanho da opção da barra lateral em 2% */
}

.sidebar-item:hover img, .sidebar-subitem:hover img,
.sidebar-item:hover .material-symbols-outlined, .sidebar-subitem:hover .material-symbols-outlined {
    transform: scale(1.05); /* Aumenta o tamanho da imagem em 5% */
}

.sidebar-item:hover span, .sidebar-subitem:hover span {
    transform: scale(1.03); /* Aumenta o tamanho do texto em 3% */
}

.submenu {
    display: none;
    flex-direction: column;
}

.sidebar-item.active .submenu {
    display: flex;
